search = path.split(".");
path = search[0];

console.log(path);
if(path == "administrar"){
onAuthStateChanged(auth, (user) => {
  if (user) {
    const uid = user.uid;
    if(uid !== "AQ6y7NrXvMRQR1iOqmQZ4cGsNFk1"){
        console.log("logout");
        logout();
    }
  } else {
    window.location.replace("/");
  }
});
}


